class Example {
  constructor(name) {
    this.name = name;
    this.createdAt = new Date();
  }
  
  greet() {
    console.log();
  }
  
  generateRandomNumbers(count = 5) {
    const numbers = [];
    for (let i = 0; i < count; i++) {
      numbers.push(Math.floor(Math.random() * 100) + 1);
    }
    return numbers;
  }
}

// 示例使用
const example = new Example('测试用户');
example.greet();
console.log('随机数:', example.generateRandomNumbers());


